# Hàm XOR encryption
def xor_encrypt_decrypt(data, key):
    return ''.join(chr(ord(c) ^ key) for c in data)

# Hàm ROT13 encryption
def rot13(text):
    return text.translate(str.maketrans("ABCDEFGHIJKLMabcdefghijklmNOPQRSTUVWXYZnopqrstuvwxyz", 
                                        "NOPQRSTUVWXYZnopqrstuvwxyzABCDEFGHIJKLMabcdefghijklm"))

# Hàm pyrmor (mã hóa dựa trên bản đồ thay thế)
def pyrmor_encode(text):
    return ''.join(chr(ord(c) + 3) for c in text)

def pyrmor_decode(text):
    return ''.join(chr(ord(c) - 3) for c in text)

